import React, { Component, Fragment } from 'react'
import Lista from '../components/ListProp'
import { Paper, Grid } from '@material-ui/core';

export default class Ventas extends Component {
    state = {
        value: 1,
        prop: [],
        category: "ventas"
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }





    render() {
        const { value } = this.state
        const { category } = this.state
        const { prop } = this.state
        return (
            <div>
                <Fragment>
                    <Grid item xs={12}>
                        <Paper className='paper_prim'>
                            <h1>Propiedades en Venta </h1>
                        </Paper>
                    </Grid>
                    <Lista value={value} category={category}/>
                </Fragment>
            </div>
        )
    }
}
